const Noticia = (props) => {

    const{urlToImage, url, title, description, source} = props.noticia;

    let imagen;
    if(urlToImage !== ''){
        imagen = <img src={urlToImage} alt={title} className="card-image-top" />
    }else{
        imagen =<p>Imagen no disponible</p>
    }

    return ( 
        <div className="col-md-6 col-12 mb-4">
            <div className="card">
                <div className="card-image">
                    {imagen}
                </div>
            </div>
        </div>
     );
}
 
export default Noticia;
